import React from 'react';
import { TextField } from '@material-ui/core';
import {createMuiTheme,makeStyles,createStyles,Theme as AugmentedTheme,ThemeProvider} from "@material-ui/core/styles";

const useStyles = makeStyles(theme =>
    createStyles({
        root: {
            flexGrow: 1,
            "& .MuiInputBase-input": {
              color: "#FFFFFF", // Text color
            },
            "& .MuiInput-underline:before": {
              display: "none",
              borderBottomColor: "#fff", // Semi-transparent underline
            },
            "& .MuiInput-underline:hover:before": {
              display: "none",
              borderBottomColor: "#fff", // Solid underline on hover
            },
            "& .MuiInput-underline:after": {
              display: "none",
              borderBottomColor: "#fff", // Solid underline on focus
            },
          },
    }
    ));

const TextFieldComponent = ({label , variant}) => {
    const classes = useStyles();
    return (
    <TextField id="basic" label={label} InputProps={{ className: classes.root },{ disableUnderline: true }}  />
    );
}

export default TextFieldComponent;
